import './App.js'
import createSudoku  from './App.js'
import React from 'react'
import ReactDOM from 'react-dom'
import './index.css'
let sudoku=createSudoku()
let count=0;
let temp=JSON.parse(JSON.stringify(sudoku));
for(let i=0;i<temp.length;i++)
{
  for(let j=0;j<temp[i].length;j++)
  temp[i][j]=count++;
}
const root=ReactDOM.createRoot(document.getElementById('root'));
class Start extends React.Component{
  func=()=>{
    root.render(<Sudoku />)
  }
  render(){
    return(
      <button className='startButton' onClick={this.func}>
        Click to Start
      </button>
    )
  }
}
class Sudoku extends React.Component{
  render(){
    return (<div className='Sudoku'>
      {//sudoku.map((arr,index)=>{return <Row arr={arr} r={index}/>})
      sudoku}
      </div>
    )
  }
}
class Row extends React.Component{
  constructor(props)
  {
    super(props)
  }
  render()
  {
    return(
      this.props.arr.map((val,index)=>{
        if(val==-1)
        return <Input r={this.props.r} c={index}/>
        else
        return <Element val={val}/>
      })
    )
  }
}
class Input extends React.Component{
  constructor(props)
  {
    super(props)
  }
  render(){
    return <input className='Element1' type="text"/>
  }
}
class Element extends React.Component{
  constructor(props)
  {
    super(props)
  }
  render(){
   return( <div className='Element'>
      {this.props.val}
    </div>)
  }
}
root.render(<Start/>)
